<script>
  import { onMount } from "svelte";
  import { createTimeline, svg, stagger } from "animejs";

  // Props
  export let duration = 4000;
  export let delay = 0; // Delay before starting the animation (ms)
  export let strokeColor = "#39ff14";
  export let strokeWidth = 1;
  export let autoplay = true;
  export let loop = false;

  // Internal refs
  let svgElement;
  let timeline;

  onMount(() => {
    // Get paths within this specific component instance
    const paths = svgElement.querySelectorAll("path");

    timeline = createTimeline({
      autoplay: false, // We'll control this manually for delay support
      loop: loop,
    });

    timeline.add(svg.createDrawable(paths), {
      draw: ["0 0", "0 1", "1 1"],
      strokeWidth: [0, strokeWidth],
      duration: duration,
      ease: "inOutSine",
      delay: stagger(Math.round(duration * 0.02)), // Dynamic stagger based on duration
    });

    // Handle delayed start
    let delayTimeout;
    if (autoplay) {
      if (delay > 0) {
        delayTimeout = setTimeout(() => {
          timeline.play();
        }, delay);
      } else {
        timeline.play();
      }
    }

    return () => {
      if (delayTimeout) clearTimeout(delayTimeout);
      if (timeline) timeline.pause();
    };
  });

  // Expose play/pause methods if needed
  export const play = () => timeline && timeline.play();
  export const pause = () => timeline && timeline.pause();
  export const restart = () => timeline && timeline.restart();
</script>

